import React from 'react';
import './MercatorMap.css'; // Import the CSS file

function MercatorMap() {
  return (
    <div className="mercator-map">
      <a href="/region/north-america" className="region north-america"></a>
      <a href="/region/south-america" className="region south-america"></a>
      <a href="/region/europe" className="region europe"></a>
      <a href="/region/africa" className="region africa"></a>
      <a href="/region/asia" className="region asia"></a>
      <a href="/region/australia" className="region australia"></a>
      <a href="/region/antarctica" className="region antarctica"></a>
    </div>
  );
}

export default MercatorMap;
